import React from 'react';
import {
    GrowHorizontalLine, GrowVerticalLine, DottedLineExpand, LineBreathe,
    GlowingLine, LinePulse, DashAnimatedLine, LineShrink,
    ColorTransitionLine, WavyLine
} from './StyledComp';  // Update the path

const LineTester = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h2>Grow Horizontal Line</h2>
      <GrowHorizontalLine />

      <h2>Grow Vertical Line</h2>
      <GrowVerticalLine />

      <h2>Dotted Line Expand</h2>
      <DottedLineExpand />

      <h2>Line Breathe</h2>
      <LineBreathe />

      <h2>Glowing Line</h2>
      <GlowingLine />

      <h2>Line Pulse</h2>
      <LinePulse />

      <h2>Dash Animated Line</h2>
      <DashAnimatedLine />

      <h2>Line Shrink</h2>
      <LineShrink />

      <h2>Color Transition Line</h2>
      <ColorTransitionLine />

      <h2>Wavy Line</h2>
      <WavyLine />
    </div>
  );
};

export default LineTester;
